@Test
    public void testAssertIdsSuccess() throws SW360Exception {
        Set<ObjectWithId> set = Sets.newHashSet(new ObjectWithId(true), new ObjectWithId(true));

        SW360Assert.assertIds(set, o -> o.isSet());
    }

